  [],\n\t\"revision_timestamp\": \"2013-03-15T21:14:56.856313\",\n\t\"name\": \"farm-process-fmp-parameters-used-in-the-central-valley-hydrologic-model-cvhm\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This digital dataset defines the farm-process
  parameters used in the transient hydrologic model of the Central Valley flow system.
  The Central Valley encompasses an approximate 50,000 square-kilometer region of
  California. The complex hydrologic system of the Central Valley is simulated using
  the USGS numerical modeling code MODFLOW-FMP. This simluation is referred to here
  as the Central Valley Hydrologic Model (CVHM) (Faunt, 2009). Utilizing MODFLOW-FMP,
  the CVHM simulates groundwater and surface-water flow, irrigated agriculture, land
  subsidence, and other key processes in the Central Valley on a monthly basis from
  1961-2003. The Farm Process parameters for Crops, Root Depth, Runoff, Pressure,
  Crop Coefficients (Kc), Transpiratory fraction of consumptive use (FTR), Evaporative
  fraction of consumptive use related to precipitation (FEP), and Evaporative fraction
  of consumptive use related to irrigation (FEI) are all tabulated. More detailed
  descriptions of these parameters can be found in Schmid and others (2006b) and Faunt
  and others (2009). The CVHM is the most recent regional-scale model of the Central
  Valley developed by the U.S. Geological Survey (USGS). The CVHM was developed as
  part of the USGS Groundwater Resources Program (see \"Foreword\", Chapter A, page
  iii, for details).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
